import React from 'react'
import data from './data';

const url1 = "https://www.google.com/search?q=Jubin+Nautiyal&oq=ju&aqs=chrome.0.69i59j69i57j0i67l2j46i199i433i465i512j46i67i199i465j46i20i263i433i512j0i20i263i433i512j46i199i433i465i512j46i433i512.2666j0j15&sourceid=chrome&ie=UTF-8";
const url2 = "https://www.google.com/search?q=asees+kuar&sxsrf=AOaemvJNwl3hQeqkmTIkflkEap6Hcbu3_g%3A1642341144727&ei=GCPkYbfjK42VseMPld6IkA4&ved=0ahUKEwi3z5_Etbb1AhWNSmwGHRUvAuIQ4dUDCA4&uact=5&oq=asees+kuar&gs_lcp=Cgdnd3Mtd2l6EAMyBAgAEEcyBAgAEEcyBAgAEEcyBAgAEEcyBAgAEEcyBAgAEEcyBAgAEEcyBAgAEEdKBAhBGABKBAhGGABQ_gdYu-wBYLLyAWgAcAZ4BYABwi6IAffYAZIBAzktNZgBAKABAbABCMgBCMABAQ&sclient=gws-wiz";

function Album({ data }) {
    return (
        <div className='main'>
            {/* <img src="https://a10.gaanacdn.com/gn_img/albums/10q3Zj1352/q3ZR6q4035/size_l_1629048201.webp"></img> */}
            <img>{data.imgUrl}</img>
            <h1>Shershaah</h1>
            <div className='anchor'>
                <a href={url1}>Jubin Nautiyal</a>
                <a href={url2}>Asees Kaur</a>
            </div>


        </div>
    )
}

export default Album;
